import React from 'react';

class OutputTarefas extends React.Component{
    constructor(props){
        super(props)
    }



    render = () =>{
        return(
            <div>
                <ul>
                    <li>Tarefa1</li>
                    <li>Tarefa2</li>
                    <li>Tarefa3</li>
                </ul>
            </div>
        )
    }
}

export default OutputTarefas;
